// 
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./pages/LoginPage"; // LoginPage.js 파일 임포트
import NutritionPage from "./pages/NutritionPage"; // 예제: 다른 페이지 임포트
import HabitPage from "./pages/HabitPage"; // 예제: 습관 페이지

const App = () => {
  return (
    <Router>
      <Routes>
        {/* LoginPage를 기본 경로로 설정 */}
        <Route path="/" element={<LoginPage />} />

        {/* 추가 페이지 예제 */}
        <Route path="/nutrition" element={<NutritionPage />} />
        <Route path="/habit" element={<HabitPage />} />
      </Routes>
    </Router>
  );
};

export default App;
